features.script:
let animation1 = feature.createAnimation('rotation')

animation1.setKeys([{
  frame: 68000, // very large number for long rotation
  value: new Vector3(0, 999.4, 0) // 999 controls speed
}])

parcel.on('playerenter', () => {
  animation1.loopMode=2
  feature.startAnimations( [animation1] ) //Starts the animation
})

